import{_ as a}from"./方案结构-4e799023.js";import{_ as e,p as h,q as r,a1 as d}from"./framework-96b046e1.js";const i={},p=d('<h2 id="拆单页面" tabindex="-1"><a class="header-anchor" href="#拆单页面" aria-hidden="true">#</a> 拆单页面</h2><h3 id="操作建议" tabindex="-1"><a class="header-anchor" href="#操作建议" aria-hidden="true">#</a> 操作建议</h3><p>这里一般为前端设计出错，在问题较多的情况下，修改前端。后端修改不推荐。</p><h3 id="方案结构" tabindex="-1"><a class="header-anchor" href="#方案结构" aria-hidden="true">#</a> 方案结构</h3><p><img src="'+a+'" alt=""></p><p>方案结构的作用，通过产品树，能够快速定位对应柜体及元素对象。</p><h4 id="操作技巧" tabindex="-1"><a class="header-anchor" href="#操作技巧" aria-hidden="true">#</a> 操作技巧</h4><p>双击元件快速定位</p><p>勾选/取消勾选可显示/隐藏相应的板件，五金及柜体。</p><h4 id="方案结构右键" tabindex="-1"><a class="header-anchor" href="#方案结构右键" aria-hidden="true">#</a> 方案结构右键</h4><h5 id="添加为部件工艺" tabindex="-1"><a class="header-anchor" href="#添加为部件工艺" aria-hidden="true">#</a> 添加为部件工艺</h5><p>把适配好的，可以固定的组件或柜体或板件（通常为板件）保存为工艺库。之后不需要重新为此对象添加工艺。</p><h5 id="添加为基础版" tabindex="-1"><a class="header-anchor" href="#添加为基础版" aria-hidden="true">#</a> 添加为基础版</h5><p>这里在CAD板件中为<strong>特殊板件</strong>，其实特殊板件这个称呼也确实更为贴切。</p><p>特殊板件可以设置此板件</p><blockquote><p>纹理方向（强制）</p><p>是否不输出（设置是否输出至料单）</p><p>不碰撞出槽（设置是否可以被其他板件嵌入开槽）</p><p>薄板被动开孔（当这个板件为薄板时，是否能被打孔）</p><p>不能被动打孔（不被其他板件碰撞产生五金）</p><p>不能被动打孔面（对上方功能，指定某个面生效）</p><p>接触面也封边（有些板件在接触面不需要封边，情况极少）</p><p>备注（备注会输出到料单）</p></blockquote><h5 id="查看产品id" tabindex="-1"><a class="header-anchor" href="#查看产品id" aria-hidden="true">#</a> 查看产品ID</h5><p>查看到ID之后。可以去后台搜索并设置已适配好的基础板或工艺库。</p><h4 id="上箭头按钮" tabindex="-1"><a class="header-anchor" href="#上箭头按钮" aria-hidden="true">#</a> 上箭头按钮</h4><p>快速折叠产品结构树</p><h4 id="下箭头按钮" tabindex="-1"><a class="header-anchor" href="#下箭头按钮" aria-hidden="true">#</a> 下箭头按钮</h4><p>快速展开产品结构树</p><h4 id="放大镜-按关键字搜索-按钮" tabindex="-1"><a class="header-anchor" href="#放大镜-按关键字搜索-按钮" aria-hidden="true">#</a> 放大镜(按关键字搜索)按钮</h4><p>快速查询</p><p>查询方法：</p><blockquote><p><a href="#%E5%90%8D%E7%A7%B0">对象名称</a></p><p><a href="#%E7%BC%96%E5%8F%B7">对象编号</a></p></blockquote><h4 id="房子-按房间查看-按钮" tabindex="-1"><a class="header-anchor" href="#房子-按房间查看-按钮" aria-hidden="true">#</a> 房子(按房间查看)按钮</h4><p>定位房间从而只显示对应房间的柜体。</p><h3 id="属性信息" tabindex="-1"><a class="header-anchor" href="#属性信息" aria-hidden="true">#</a> 属性信息</h3><p>此处会放置选中对象所有的信息</p><h4 id="名称" tabindex="-1"><a class="header-anchor" href="#名称" aria-hidden="true">#</a> 名称</h4><p>对象的名称，并且在<a href="#%E6%94%BE%E5%A4%A7%E9%95%9C-%E6%8C%89%E5%85%B3%E9%94%AE%E5%AD%97%E6%90%9C%E7%B4%A2-%E6%8C%89%E9%92%AE">搜索</a>功能中也可以快速查询。</p><h4 id="编号" tabindex="-1"><a class="header-anchor" href="#编号" aria-hidden="true">#</a> 编号</h4><p>板件唯一编号，在之后的标签和拆单后的表格里都能查询。并且在<a href="#%E6%94%BE%E5%A4%A7%E9%95%9C-%E6%8C%89%E5%85%B3%E9%94%AE%E5%AD%97%E6%90%9C%E7%B4%A2-%E6%8C%89%E9%92%AE">搜索</a>功能中也可以快速查询。</p><h4 id="类型" tabindex="-1"><a class="header-anchor" href="#类型" aria-hidden="true">#</a> 类型</h4><p>此处会后台自动分析这个板件的类型。但是一般类型都区别不大。但是如果是门板类型的，则不会被打孔，拉槽等。</p><h4 id="位置" tabindex="-1"><a class="header-anchor" href="#位置" aria-hidden="true">#</a> 位置</h4><p>可以修改查阅板件的世界坐标，临时修改位置</p><h4 id="大小" tabindex="-1"><a class="header-anchor" href="#大小" aria-hidden="true">#</a> 大小</h4><p>可以临时修改板件的长宽高，但这个长宽高也是基于世界轴的。所以只能根据尺寸或者尝试判断。但是在这里修改的概率很小，并且也不建议在此处修改。</p><p>如果修改，相对于的尺寸是从对象中心处放缩。而不是从一边向另一边。</p><h4 id="类型-输入框" tabindex="-1"><a class="header-anchor" href="#类型-输入框" aria-hidden="true">#</a> 类型（输入框）</h4><p>这里可以修改当前板件类型。一般是前端使用错误的模型需要临时修改而准备的功能。主要是把门板类型换成其他类型，以开启打孔拉槽等功能。</p><h4 id="材质id-输入框" tabindex="-1"><a class="header-anchor" href="#材质id-输入框" aria-hidden="true">#</a> 材质ID（输入框）</h4><p>因为分辨率的因素，可能看起来像是材质II</p><p>这里可以获取到当前对象的材质ID。并且去后台对相应材质进行增加，删除，修改，查询。</p><h4 id="材质-输入框" tabindex="-1"><a class="header-anchor" href="#材质-输入框" aria-hidden="true">#</a> 材质（输入框）</h4><p>显示对应材质ID的材质名称</p><h4 id="补板-输入框" tabindex="-1"><a class="header-anchor" href="#补板-输入框" aria-hidden="true">#</a> 补板（输入框）</h4><p>如果此项为1（true）则进入补板列表。否则不为补板</p><h4 id="不碰撞出槽-输入框" tabindex="-1"><a class="header-anchor" href="#不碰撞出槽-输入框" aria-hidden="true">#</a> 不碰撞出槽（输入框）</h4><p>如果此项为1（true）则不能被出槽。否则可以出槽</p><h4 id="薄板被动开孔-输入框" tabindex="-1"><a class="header-anchor" href="#薄板被动开孔-输入框" aria-hidden="true">#</a> 薄板被动开孔（输入框）</h4><p>如果此项为1（true）则如果为薄板可以被打孔。否则不可被打孔</p><h4 id="不能被动打孔-输入框" tabindex="-1"><a class="header-anchor" href="#不能被动打孔-输入框" aria-hidden="true">#</a> 不能被动打孔（输入框）</h4><p>如果此项为1（true）则不可以被打孔。否则就可以被打孔</p><h4 id="备注-输入框" tabindex="-1"><a class="header-anchor" href="#备注-输入框" aria-hidden="true">#</a> 备注（输入框）</h4><p>这里输入的信息会被导出到料单</p><h4 id="保存按钮" tabindex="-1"><a class="header-anchor" href="#保存按钮" aria-hidden="true">#</a> 保存按钮</h4><p>以上有输入框的选项，修改之后，保存之后，在刷新之后才可以生效。</p><h4 id="下方显示栏" tabindex="-1"><a class="header-anchor" href="#下方显示栏" aria-hidden="true">#</a> 下方显示栏</h4><p>因为内容项目太多，并且不可修改，所以就不在阐述。可以结合上方综合判断。</p><h3 id="主页面操作" tabindex="-1"><a class="header-anchor" href="#主页面操作" aria-hidden="true">#</a> 主页面操作</h3><h4 id="透视视图切换" tabindex="-1"><a class="header-anchor" href="#透视视图切换" aria-hidden="true">#</a> 透视视图切换</h4><p>选择可以把所有板件材质透明，可以快速观测线条或五金。</p><h4 id="爆炸视图切换" tabindex="-1"><a class="header-anchor" href="#爆炸视图切换" aria-hidden="true">#</a> 爆炸视图切换</h4><p>选择可以进入爆炸视图。</p><h4 id="碰撞分析" tabindex="-1"><a class="header-anchor" href="#碰撞分析" aria-hidden="true">#</a> 碰撞分析</h4><p>板件的碰撞检测分析。</p><h4 id="一键拆单" tabindex="-1"><a class="header-anchor" href="#一键拆单" aria-hidden="true">#</a> 一键拆单</h4><p>点击之后拆单。一般为审单的最后一步操作。</p><h4 id="更多操作选项" tabindex="-1"><a class="header-anchor" href="#更多操作选项" aria-hidden="true">#</a> <a href="#%E6%9B%B4%E5%A4%9A%E6%93%8D%E4%BD%9C%E9%80%89%E9%A1%B9-1">更多操作选项</a></h4><p>此项目内容过多，单独讲解</p><h4 id="右键" tabindex="-1"><a class="header-anchor" href="#右键" aria-hidden="true">#</a> <a href="#%E5%8F%B3%E9%94%AE-1">右键</a></h4><p>此项目内容过多，单独讲解</p><h3 id="更多操作选项-1" tabindex="-1"><a class="header-anchor" href="#更多操作选项-1" aria-hidden="true">#</a> 更多操作选项</h3><p>里面有很多选项，并且会随着之后的更新，有可能增加选项。</p><h4 id="五金碰撞" tabindex="-1"><a class="header-anchor" href="#五金碰撞" aria-hidden="true">#</a> 五金碰撞</h4><p>五金之间相互的碰撞。但是碰撞检测机制是五金的最大轮廓的立方体为检测体积。</p><p>也可以根据不同五金的设置而屏蔽检测。</p><h4 id="孔槽碰撞" tabindex="-1"><a class="header-anchor" href="#孔槽碰撞" aria-hidden="true">#</a> 孔槽碰撞</h4><p>打孔的五金和拉槽的五金及板件拉槽的重叠检测</p><h4 id="五金规避" tabindex="-1"><a class="header-anchor" href="#五金规避" aria-hidden="true">#</a> 五金规避</h4><p>在以上两种碰撞的时候，会自动规避16的倍数距离</p><div class="custom-container tip"><p class="custom-container-title">TIP</p><p>为什么是16？因为默认32的情况下，避让距离过大，与另一个五金的碰撞的概率会更大，也可能会因为窄条的宽度不够宽。而无法规避。16的偏置也比常规的五金最大孔径大一些。并且也是32的1/2。</p></div><h4 id="漏孔检测" tabindex="-1"><a class="header-anchor" href="#漏孔检测" aria-hidden="true">#</a> 漏孔检测</h4><p>如果两个板件之间可以打孔，但是没有出孔。可以检测出来提醒。</p><p>但如果板件之间有间距，则不能被识别。这种概率极小，并且出现在手动编辑轮廓的可能性才是最大的。</p><h4 id="漏边检测" tabindex="-1"><a class="header-anchor" href="#漏边检测" aria-hidden="true">#</a> 漏边检测</h4><p>存在没有封边的边。会做出提示。</p><h4 id="应用通用工艺" tabindex="-1"><a class="header-anchor" href="#应用通用工艺" aria-hidden="true">#</a> 应用通用工艺</h4><p>快速的根据企业的设置的工艺对相应柜体进行快速适配工艺</p><h4 id="隐藏所有门板" tabindex="-1"><a class="header-anchor" href="#隐藏所有门板" aria-hidden="true">#</a> 隐藏所有门板</h4><p>隐藏门板类别的板件。从而更方便观测</p><h4 id="显示材质颜色" tabindex="-1"><a class="header-anchor" href="#显示材质颜色" aria-hidden="true">#</a> 显示材质颜色</h4><p>如果企业材质有设置后台，则能够做材质区分。但是因大部分企业的材质统计不完整或材质更迭较快。所以适配的情况可能不尽人意。但基本不影响。</p><h4 id="显示纹理方向" tabindex="-1"><a class="header-anchor" href="#显示纹理方向" aria-hidden="true">#</a> 显示纹理方向</h4><p>会在板件上显示出一根红线，做纹理的显示。但是实际情况下，纹理必然存在纹理。只是不区分方向的纹理。所以无纹理的材质，也依然会显示纹理。这里不影响。</p><h4 id="酷家乐设计" tabindex="-1"><a class="header-anchor" href="#酷家乐设计" aria-hidden="true">#</a> 酷家乐设计</h4><p>在企业选购酷家乐有API接口的用户，这里可以跳转回酷家乐。</p><h4 id="查看补板清单" tabindex="-1"><a class="header-anchor" href="#查看补板清单" aria-hidden="true">#</a> 查看补板清单</h4><p>在右键<a href="#%E6%B7%BB%E5%8A%A0%E4%B8%BA%E8%A1%A5%E6%9D%BF">添加为补板</a>的板件，一个已选补板板件的整体清单。</p><div class="custom-container tip"><p class="custom-container-title">TIP</p><p>补板的机制是提供下载筛选，并不具备修改工艺的功能。<br></p><p>如果修改了工艺，单独操作补板无效。需要拆单之后，下载补板料单。</p></div><h4 id="用料分析" tabindex="-1"><a class="header-anchor" href="#用料分析" aria-hidden="true">#</a> 用料分析</h4><p>新功能：</p><p>在正常情况下，拆单之后才知道我们已经使用的材质、封边、五金。但是具备这个功能，可以提前列出已用的物料清单。从而自行排查。</p><h4 id="尺寸超限板材检测" tabindex="-1"><a class="header-anchor" href="#尺寸超限板材检测" aria-hidden="true">#</a> 尺寸超限板材检测</h4><p>新功能：</p><p>在后台数据中，可以提前预设好相应材质的尺寸，可以使用这个检测，避免板材超过原材料尺寸。</p><hr><h3 id="右键-1" tabindex="-1"><a class="header-anchor" href="#右键-1" aria-hidden="true">#</a> 右键</h3><p>在左键选择对象之后，鼠标右键单击弹出右键菜单。</p><h4 id="隐藏板件" tabindex="-1"><a class="header-anchor" href="#隐藏板件" aria-hidden="true">#</a> 隐藏板件</h4><p>快捷键<code>H</code>，也可以勾选<a href="#%E6%96%B9%E6%A1%88%E7%BB%93%E6%9E%84">方案结构</a></p><h4 id="参考方向" tabindex="-1"><a class="header-anchor" href="#参考方向" aria-hidden="true">#</a> 参考方向</h4><p>需配合<a href="#%E7%BD%AE%E4%B8%BA%E8%87%AA%E5%8A%A8AB%E9%9D%A2">置为自动AB面</a></p><blockquote><p>参考方向置为A</p><blockquote><p>五金打孔，把开孔面换为A面。</p></blockquote><p>参考方向置为B</p><blockquote><p>五金打孔，把开孔面换为B面。</p></blockquote></blockquote><h4 id="置为检测漏孔" tabindex="-1"><a class="header-anchor" href="#置为检测漏孔" aria-hidden="true">#</a> 置为检测漏孔</h4><blockquote><p>置为不检测漏孔</p><blockquote><p>临时修改指定板件不检测此板件漏孔</p></blockquote><p>置为检测漏孔</p><blockquote><p>临时修改指定板件检测此板件漏孔（默认）</p></blockquote></blockquote><h4 id="设置侧边相连" tabindex="-1"><a class="header-anchor" href="#设置侧边相连" aria-hidden="true">#</a> 设置侧边相连</h4><blockquote><p>设置侧边不相连（默认）</p><blockquote><p>临时修改指定板件侧面不相连</p></blockquote><p>设置侧边相连</p><blockquote><p>临时修改指定板件侧面相连</p></blockquote></blockquote><h4 id="置为自动ab面" tabindex="-1"><a class="header-anchor" href="#置为自动ab面" aria-hidden="true">#</a> 置为自动AB面</h4><blockquote><p>置为自动AB面（默认）</p><blockquote><p>临时修改指定板件孔位自动AB面翻转</p></blockquote><p>置为不自动AB面</p><blockquote><p>临时修改指定板件孔位不自动AB面翻转</p></blockquote></blockquote><h4 id="置为单饰面" tabindex="-1"><a class="header-anchor" href="#置为单饰面" aria-hidden="true">#</a> 置为单饰面</h4><p>无默认，如有指定单饰面板。建议勾选。会影响打孔或者异形开料。</p><blockquote><p>置为单饰面A</p><blockquote><p>临时修改板件为单面饰面板，饰面在A面</p></blockquote><p>置为单饰面B</p><blockquote><p>临时修改板件为单面饰面板，饰面在B面</p></blockquote><p>取消单饰面设置</p><blockquote><p>取消则为双饰面设置</p></blockquote></blockquote><h4 id="改变纹理方向" tabindex="-1"><a class="header-anchor" href="#改变纹理方向" aria-hidden="true">#</a> 改变纹理方向</h4><p>点击生效，纹理旋转90度。<a href="#%E5%BB%BA%E8%AE%AE">建议</a></p><h4 id="添加为补板" tabindex="-1"><a class="header-anchor" href="#添加为补板" aria-hidden="true">#</a> 添加为补板</h4><p>点击添加。进入<a href="#%E6%9F%A5%E7%9C%8B%E8%A1%A5%E6%9D%BF%E6%B8%85%E5%8D%95">查看补板清单</a></p><div class="custom-container tip"><p class="custom-container-title">TIP</p><p>补板的机制是提供下载筛选，并不具备修改工艺的功能。<br></p><p>如果修改了工艺，单独操作补板无效。需要拆单之后，下载补板料单。</p></div><h4 id="复制工艺" tabindex="-1"><a class="header-anchor" href="#复制工艺" aria-hidden="true">#</a> 复制工艺</h4><p>复制当前指定板件的工艺</p><p>切换五金，例如三合一换二合一<a href="#%E5%BB%BA%E8%AE%AE">建议</a></p><h4 id="复制材质" tabindex="-1"><a class="header-anchor" href="#复制材质" aria-hidden="true">#</a> 复制材质</h4><p>复制当前指定板件的材质<a href="#%E5%BB%BA%E8%AE%AE">建议</a></p><h4 id="粘贴工艺" tabindex="-1"><a class="header-anchor" href="#粘贴工艺" aria-hidden="true">#</a> 粘贴工艺</h4><p>只有在复制工艺之后显示</p><div class="custom-container tip"><p class="custom-container-title">TIP</p><p>当前未选中板件，请选择板件！<br></p><p>是因为和复制材质一同使用了，需要重新复制</p></div><p>粘贴刚才的工艺到现在选择的板件</p><blockquote><p>[x]拷贝<a href="#%E5%B8%83%E7%BD%AE%E6%96%B9%E6%A1%88">布置方案</a></p><p>[x]拷贝<a href="#%E5%A4%96%E9%83%A8%E4%BA%94%E9%87%91">外部五金</a></p><p>[x]拷贝<a href="#%E5%B0%81%E8%BE%B9">封边</a></p><p>勾选项才能粘贴</p></blockquote><h4 id="粘贴材质" tabindex="-1"><a class="header-anchor" href="#粘贴材质" aria-hidden="true">#</a> 粘贴材质</h4><p>只有在复制材质之后显示</p><p>粘贴刚才的材质到现在选择的板件</p><h3 id="提示窗口" tabindex="-1"><a class="header-anchor" href="#提示窗口" aria-hidden="true">#</a> 提示窗口</h3><p>在各种检测分析时，会弹出各种窗口</p><p>不同颜色的报警，严重程度不同。但不同检测的颜色也不同。</p><p><strong>双击对应的警报或提示，可以快速定位报警提示的位置。</strong></p><h4 id="板件碰撞" tabindex="-1"><a class="header-anchor" href="#板件碰撞" aria-hidden="true">#</a> 板件碰撞</h4><p>板件之间的碰撞情况<a href="#%E5%BB%BA%E8%AE%AE">建议</a></p><p>无提示则无碰撞</p><h5 id="红色不出槽" tabindex="-1"><a class="header-anchor" href="#红色不出槽" aria-hidden="true">#</a> 红色不出槽</h5><p>板件之间的交叠。一般为两个模型重叠部分</p><h5 id="紫色出槽" tabindex="-1"><a class="header-anchor" href="#紫色出槽" aria-hidden="true">#</a> 紫色出槽</h5><p>板件之间产生了超宽的槽。一般只有薄板才出槽</p><h5 id="绿色出槽" tabindex="-1"><a class="header-anchor" href="#绿色出槽" aria-hidden="true">#</a> 绿色出槽</h5><p>两个板件互相出凹型开缺，相互锁紧，一般都是酒格槽。</p><h5 id="蓝色出槽" tabindex="-1"><a class="header-anchor" href="#蓝色出槽" aria-hidden="true">#</a> 蓝色出槽</h5><p>背板和普通板件的槽。</p><h4 id="五金碰撞-1" tabindex="-1"><a class="header-anchor" href="#五金碰撞-1" aria-hidden="true">#</a> 五金碰撞</h4><p>无提示则无碰撞</p><h4 id="孔槽碰撞-1" tabindex="-1"><a class="header-anchor" href="#孔槽碰撞-1" aria-hidden="true">#</a> 孔槽碰撞</h4><p>无提示则无碰撞</p><h4 id="漏孔检测-1" tabindex="-1"><a class="header-anchor" href="#漏孔检测-1" aria-hidden="true">#</a> 漏孔检测</h4><p>无提示则无漏孔</p><h4 id="漏边检测-1" tabindex="-1"><a class="header-anchor" href="#漏边检测-1" aria-hidden="true">#</a> 漏边检测</h4><p>无提示则无漏边</p><h3 id="工艺栏" tabindex="-1"><a class="header-anchor" href="#工艺栏" aria-hidden="true">#</a> 工艺栏</h3><p>在选中板件之后，右侧会弹出灰色部分的工艺栏。</p><h4 id="布置方案" tabindex="-1"><a class="header-anchor" href="#布置方案" aria-hidden="true">#</a> 布置方案</h4><p>可以针对某个点至另一个点的五金配置</p><h5 id="布置方案-1" tabindex="-1"><a class="header-anchor" href="#布置方案-1" aria-hidden="true">#</a> 布置方案</h5><p>可以观察当前的配置详情</p><h5 id="显示匹配" tabindex="-1"><a class="header-anchor" href="#显示匹配" aria-hidden="true">#</a> 显示匹配</h5><p>可以显示当前适配好的五金，如果不显示，则没有相对于尺寸的配置</p><h5 id="布置方向" tabindex="-1"><a class="header-anchor" href="#布置方向" aria-hidden="true">#</a> 布置方向</h5><p>在前后不对称配置的情况下，可以前后调头。</p><h5 id="参考方向-1" tabindex="-1"><a class="header-anchor" href="#参考方向-1" aria-hidden="true">#</a> 参考方向</h5><p>五金的孔位朝向调整</p><p>但这里存在工艺库的情况下，优先工艺库。</p><p>通用工艺的情况下，优先适配高度来自动区分AB面。</p><h5 id="操作" tabindex="-1"><a class="header-anchor" href="#操作" aria-hidden="true">#</a> 操作</h5><blockquote><p>[+]</p><blockquote><p>新增一组工艺库</p></blockquote><p>[-]</p><blockquote><p>删除对应边所有工艺</p></blockquote><p>删除</p><blockquote><p>删除对应边指定工艺</p></blockquote></blockquote><h4 id="外部五金" tabindex="-1"><a class="header-anchor" href="#外部五金" aria-hidden="true">#</a> 外部五金</h4><p>可以针对某个点至另一个点的单独的五金配置</p><h5 id="操作-1" tabindex="-1"><a class="header-anchor" href="#操作-1" aria-hidden="true">#</a> 操作</h5><blockquote><p>[+]</p><blockquote><p>新增一个五金</p></blockquote><p>[-]</p><blockquote><p>删除对应边所有五金</p></blockquote><p>删除</p><blockquote><p>删除对应边指定五金</p></blockquote></blockquote><h5 id="五金" tabindex="-1"><a class="header-anchor" href="#五金" aria-hidden="true">#</a> 五金</h5><p>可以观察当前的五金详情</p><h5 id="起点距离" tabindex="-1"><a class="header-anchor" href="#起点距离" aria-hidden="true">#</a> 起点距离</h5><p>根据板件的面显示点，选择五金距离起点的边距。</p><h5 id="距边" tabindex="-1"><a class="header-anchor" href="#距边" aria-hidden="true">#</a> 距边</h5><p>这里一般不填写</p><p>这里一般为五金距离侧面（两个点所对应的面）的距离</p><h5 id="参考方向-2" tabindex="-1"><a class="header-anchor" href="#参考方向-2" aria-hidden="true">#</a> 参考方向</h5><p>五金的孔位朝向调整</p><h4 id="封边" tabindex="-1"><a class="header-anchor" href="#封边" aria-hidden="true">#</a> 封边</h4><p>可以针对某个点至另一个点的封边配置</p><h5 id="封边-1" tabindex="-1"><a class="header-anchor" href="#封边-1" aria-hidden="true">#</a> 封边</h5><p>预览当前选择的封边信息</p><h5 id="操作-2" tabindex="-1"><a class="header-anchor" href="#操作-2" aria-hidden="true">#</a> 操作</h5><blockquote><p>配置上次封边</p><blockquote><p>快速添加之前操作过的封边</p></blockquote><ul><li></li></ul><blockquote><p>添加封边</p><p>点击之后弹出选择窗口的按钮</p><blockquote><p>配置到当前封边</p><p>配置到该板件的所有封边</p><p>配置到所有板件的所有封边</p><p>关闭</p></blockquote></blockquote><ul><li></li></ul><blockquote><p>删除指定边的所有封边</p></blockquote><p>替换</p><blockquote><p>替换当前选中封边</p><p>点击之后弹出选择窗口的按钮</p><blockquote><p>替换该柜体该类型封边</p><p>替换该柜体才值班的该类型封边</p><p>替换所有该材质板件的该类型封边</p><p>替换该类型封边</p><p>替换所有板件的所有边</p><p>关闭</p></blockquote></blockquote></blockquote>',202),t=[p];function n(c,o){return h(),r("div",null,t)}const u=e(i,[["render",n],["__file","DS王石.html.vue"]]);export{u as default};
